import React, { Component } from "react";
import SideBar from "./SideBar";
import CustomerFormWithToast from "./CustomerForm";
import customerTableData from "./customerTableData";

const CustomerManagement = () => {


  return (
    <>
    <SideBar/>

    <div className="tbl">
    <table border="1">
  <caption>Cutomer Management</caption>

  <thead>
    <tr>
      <th>Name</th>
      <th>City</th>
      <th>Phone</th>
      <th>E-mail</th>
      <th>Customer Id</th>
    </tr>
  </thead>
  <tbody>
                      {customerTableData()}
   </tbody>
</table><CustomerFormWithToast/>
<input type="text" className="but" placeholder="Search"/>
<input type="button" className="but" value='Refresh' onClick={()=>{window.location.reload()}}/>
</div>


    </>
  );
};

export default CustomerManagement;
